typedef vector<int> vi;
typedef pair<int, int> ii;
typedef long long ll;
typedef unsigned long long ull;
typedef long double ld;
typedef vector<ll> vll;
typedef vector<vi> vii;

vii res;
unordered_set<string> S;

void insert(vi& seq)
{
    string s;
    for (auto& num : seq)
        s += to_string(num) + ',';
    S.insert(s);
}

void f(vi& nums, int i, vi& seq)
{
    if (seq.size() > 1)
        insert(seq);
    if (i == nums.size())
        return;

    int num = nums[i], prev = (seq.size() > 0 ? seq.back() : INT_MIN);
    if (num >= prev) {
        seq.pb(num);
        f(nums, i + 1, seq);
        seq.pop_back();
    }

    f(nums, i + 1, seq);
}

void unpack(vii& res, const string& s)
{
    int num = 0;
    vi seq;
    int i = 0;
    for (int j = 0; j < s.size(); ++j) {
        if (s[j] == ',')
            seq.pb(stoi(s.substr(i, j - i))), i = j + 1;
    }

    res.pb(seq);
}

vector<vector<int>> findSubsequences(vector<int>& nums)
{
    res.clear();
    vi seq;
    f(nums, 0, seq);
    for (auto& s : S)
        unpack(res, s);

    return res;
}

int main()
{
    vi nums = { -100, -99, -98, -97, -96, -96 };
    vii ans = findSubsequences(nums);

    for (auto& seq : ans) {
        for (auto& num : seq)
            cout << num << " ";
        cout << endl;
    }
}
